import React from "react"
import { DataGrid } from "@material-ui/data-grid";

function Table() {
  const columns = [
    { field: 'id', headerName: 'ID', width: 50 },
    { field: 'countryName', headerName: 'Country', width: 130 },
    { field: 'lastName', headerName: 'Cases', width: 130 },
  ];

  const rows = [
    { id: 1, countryName: 'Snow', cases: 'Jon'},
    { id: 2, countryName: 'Lannister', cases: 'Cersei'},
    { id: 3, countryName: 'Lannister', cases: 'Jaime'},
    { id: 4, countryName: 'Stark', cases: 'Arya'},
    { id: 5, countryName: 'Targaryen', cases: 'Daenerys'},
    { id: 6, countryName: 'Melisandre', cases: null},
    { id: 7, countryName: 'Clifford', cases: 'Ferrara'},
    { id: 8, countryName: 'Frances', cases: 'Rossini'},
    { id: 9, countryName: 'Roxie', cases: 'Harvey'},
  ];


  return (
    <div style={{ height: 400, width: '100%' }}>
      <DataGrid rows={rows} columns={columns} pageSize={5} checkboxSelection />
    </div>
  )
}

export default Table
